import React, { Component } from "react";
import { Card } from "react-bootstrap";
import "../css/HeaderCard.css";

class HeaderCard extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <Card className="card-style">
          <Card.Body>
            <Card.Title className="card-subtitle-style">Data Trends</Card.Title>
            <h1 className="card-title-style">
              Global CO<span>2</span>Emissions
            </h1>
            {/* <Card.Subtitle className="mb-2 text-muted">
              By year 2011
            </Card.Subtitle> */}
            <Card.Text>
              Climate change is one of the world’s most pressing challenges.
              Human emissions of greenhouse gases – carbon dioxide (CO2),
              nitrous oxide, methane, and others – have increased global
              temperatures by around 1℃ since pre-industrial times.
            </Card.Text>
            <Card.Link href="#">Full Story</Card.Link>
          </Card.Body>
        </Card>
      </div>
    );
  }
}

export default HeaderCard;
